import React , {Component} from 'react';
import axios from 'axios'





class Pres extends Component {

  state={

     consul:[],


   }




     componentDidMount=()=>{

       axios.get("http://127.0.0.1:8000/patients/"+92+"/")
       .then((response)=>{
  console.log(response.data.consultations)
      this.setState({consul:response.data.consultations,


    })


         })



       }



render(){

  const {consul}= this.state


return(




    <div>

    {
    consul.map(consul=>
    <div className='cns' key={consul.id}>
    <div className="cnsDate">{consul.date}</div>
    <div><h4>Type</h4><p>{consul.type}</p></div>
    <div><h4>description</h4><p>{consul.description}</p></div>
    <div><h4>outcome</h4><p>{consul.prescription_fields.map(prescription_fields=>
    <div>{prescription_fields.id}</div>)}</p></div>

    </div>  )}


    < /div>



)
}}
export default Pres;
